import { Grid } from '@material-ui/core';
import React from 'react';
import PostItem from './PostItem';

export interface PostListProps {
}

export default function PostList (props: PostListProps) {
  return (
    <Grid container>
        <Grid item xs={12} md={6} lg={3}>
            <PostItem/>
        </Grid>
    </Grid>
  );
}
